
CREATE DATABASE project2;
USE project2;

CREATE TABLE IF NOT EXISTS `roles` (`id` INTEGER NOT NULL auto_increment, `roleName` VARCHAR(255) NOT NULL, `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, PRIMARY KEY (`id`)) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `statuses` (	`id` INTEGER NOT NULL auto_increment, `status` VARCHAR(255) NOT NULL, `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, PRIMARY KEY (`id`)) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `users` (`id` INTEGER NOT NULL auto_increment, `username` VARCHAR(255) NOT NULL, `password` VARCHAR(255) NOT NULL, `email` VARCHAR(255) NOT NULL, `createdAt` DATE DEFAULT (DATE(CURRENT_TIMESTAMP)), `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `roleId` INTEGER, `statusId` INTEGER, PRIMARY KEY (`id`), FOREIGN KEY (`roleId`) REFERENCES `roles` (`id`) ON DELETE SET NULL ON UPDATE CASCADE, FOREIGN KEY (`statusId`) REFERENCES `statuses` (`id`) ON DELETE SET NULL ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `addresses` (`id` INTEGER NOT NULL auto_increment, `address` TEXT NOT NULL, `count` INTEGER NOT NULL, `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `userId` INTEGER, PRIMARY KEY (`id`), FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `delivers` (`id` INTEGER NOT NULL auto_increment, `deliverName` VARCHAR(255) NOT NULL, `createdAt` DATE DEFAULT (DATE(CURRENT_TIMESTAMP)), `deliverPrice` BIGINT NOT NULL, `freePrice` BIGINT NOT NULL, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `userId` INTEGER, PRIMARY KEY (`id`), FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE SET NULL ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `categories` (`id` VARCHAR(255) NOT NULL, `category` VARCHAR(255) NOT NULL, `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, PRIMARY KEY (`id`)) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `attributes` (`id` INTEGER NOT NULL auto_increment, `attribute` VARCHAR(255) NOT NULL, `defaultAttribute` VARCHAR(255), `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `categoryId` VARCHAR(255), PRIMARY KEY (`id`), FOREIGN KEY (`categoryId`) REFERENCES `categories` (`id`) ON DELETE CASCADE ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `shops` (`id` INTEGER NOT NULL auto_increment, `shopName` VARCHAR(255) NOT NULL, `shopInformation` TEXT, `totalFollower` INTEGER NOT NULL, `totalItem` INTEGER NOT NULL, `image` VARCHAR(255) NOT NULL, `hasImage` SMALLINT NOT NULL, `createdAt` DATE NOT NULL DEFAULT (DATE(CURRENT_TIMESTAMP)), `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `userId` INTEGER, PRIMARY KEY (`id`), FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `items` (`id` VARCHAR(255) NOT NULL, `count` INTEGER NOT NULL, `itemName` VARCHAR(255) NOT NULL, `createdAt` DATE DEFAULT (DATE(CURRENT_TIMESTAMP)), `price` BIGINT NOT NULL, `amount` INTEGER NOT NULL, `information` TEXT, `image` VARCHAR(255) NOT NULL, `priceDiscount` BIGINT NOT NULL, `itemNameUrl` VARCHAR(255) NOT NULL, `sold` INTEGER NOT NULL, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `shopId` INTEGER, `categoryId` VARCHAR(255), PRIMARY KEY (`id`), FOREIGN KEY (`shopId`) REFERENCES `shops` (`id`) ON DELETE CASCADE ON UPDATE CASCADE, FOREIGN KEY (`categoryId`) REFERENCES `categories` (`id`) ON DELETE SET NULL ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `orderstatuses` (`id` INTEGER NOT NULL auto_increment, `status` VARCHAR(255) NOT NULL, `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, PRIMARY KEY (`id`)) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `orders` (`id` INTEGER NOT NULL auto_increment, `createdAt` DATE DEFAULT (DATE(CURRENT_TIMESTAMP)), `purchasePrice` BIGINT NOT NULL, `fullName` VARCHAR(255) NOT NULL, `phone` VARCHAR(255) NOT NULL, `note` TEXT, `address` VARCHAR(255) NOT NULL, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `userId` INTEGER, `deliverId` INTEGER, `orderstatusId` INTEGER, PRIMARY KEY (`id`), FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE, FOREIGN KEY (`deliverId`) REFERENCES `delivers` (`id`) ON DELETE CASCADE ON UPDATE CASCADE, FOREIGN KEY (`orderstatusId`) REFERENCES `orderstatuses` (`id`) ON DELETE SET NULL ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `userinfos` (`id` INTEGER NOT NULL auto_increment, `fullName` VARCHAR(255), `sexual` VARCHAR(255), `birthday` DATE, `phone` VARCHAR(255), `job` VARCHAR(255), `workplace` VARCHAR(255), `otherInformation` TEXT, `hasShop` SMALLINT NOT NULL, `totalAddress` SMALLINT NOT NULL, `totalFollow` SMALLINT NOT NULL, `totalOrder` INTEGER NOT NULL, `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `userId` INTEGER, PRIMARY KEY (`id`), FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `follows` (`id` INTEGER NOT NULL auto_increment, `createdAt` DATE DEFAULT (DATE(CURRENT_TIMESTAMP)), `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `userId` INTEGER, `shopId` INTEGER, PRIMARY KEY (`id`), FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE, FOREIGN KEY (`shopId`) REFERENCES `shops` (`id`) ON DELETE CASCADE ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `carts` (`id` INTEGER NOT NULL auto_increment, `amount` INTEGER NOT NULL, `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `itemId` VARCHAR(255), `userId` INTEGER, PRIMARY KEY (`id`), FOREIGN KEY (`itemId`) REFERENCES `items` (`id`) ON DELETE CASCADE ON UPDATE CASCADE, FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `orderitems` (`id` INTEGER NOT NULL auto_increment, `amount` INTEGER NOT NULL, `purchasePrice` BIGINT NOT NULL, `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `orderId` INTEGER, `itemId` VARCHAR(255), PRIMARY KEY (`id`), FOREIGN KEY (`orderId`) REFERENCES `orders` (`id`) ON DELETE CASCADE ON UPDATE CASCADE, FOREIGN KEY (`itemId`) REFERENCES `items` (`id`) ON DELETE CASCADE ON UPDATE CASCADE) ENGINE=InnoDB;
CREATE TABLE IF NOT EXISTS `notifications` (`id` INTEGER NOT NULL auto_increment, `content` VARCHAR(255) NOT NULL, `createdAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP, `userId` INTEGER, PRIMARY KEY (`id`), FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE) ENGINE=InnoDB;

    
    








